Меня зовут Аня и я занимаюсь любимым делом, которое назвала Lino Dress ❤️

За моими плечами огромный опыт! За большое количество времени я прошла массу обучений, в том числе и по пошиву нижнего белья. В изготовлении комплектов я использую исключительно качественную железную фурнитуру, ткани и отделочные резинки турецкого производства. 

Все комплекты нижнего белья я отшиваю по индивидуальным меркам. Вы можете заказать: 
- Трусики;
- Наборы трусиков;
- Комплекты белья;
- Костюмы из бархата и муслина; 
- Корсеты. 

🌍 Доставка осуществляется по всему миру! 
Сроки изготовления заказа от 7-10 дней. 

Напиши мне в личные сообщения и мы создадим для тебя идеальный образ! С любовью, Lino Dress  ❤️
